func RandomInt(min, max int) int {
	return rand.Intn(max-min) + min
}

func RandomFloat(min, max float64) float64 {
	return min + rand.Float64()*(max-min)
}

func RandomString(length int) string {
	const charset = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ"
	rndStr := make([]byte, length)
	for i := range rndStr {
		rndStr[i] = charset[rand.Intn(len(charset))]
	}
	return string(rndStr)
}

func RandomDate() string {
	min := time.Date(2020, 1, 1, 0, 0, 0, 0, time.UTC)
	max := time.Now()
	delta := max.Unix() - min.Unix()
	sec := rand.Int63n(delta) + min.Unix()
	date := time.Unix(sec, 0).Truncate(24 * time.Hour)
	return date.Format("2006-01-02")
}

func GetImage(i int) string {
	return imgs[i]
}

func GetTopic(i int) string {
	if i >= 0 && i < 20 {
		return topics[0]
	} else if i >= 20 && i < 40 {
		return topics[1]
	} else {
		return topics[2]
	}
}

func GetName(i int) string {
	return parts[i]
}

func GetDescription(i int) string {
	return descriptions[i]
}
